import React from 'react'
import { useNavigate } from 'react-router-dom'
import './Header.css';
import Swal from 'sweetalert2';

function Header() {

    const navigate = useNavigate();

    const handleLogoutUser = (e) => {
        e.preventDefault();
        Swal.fire({
            title: 'Logout?',
            text: "Do you want to Logout?",
            icon: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: 'Logout'
        }).then((result) => {
            if (result.isConfirmed) {
                localStorage.clear();
                // dispatch({ type: 'logout' })
                navigate('/')
            }
        })
    }

    return (
        <nav c="navbar navbar-expand-lg navbar-light bg-light">
            <div c="container-fluid">

                <a c="navbar-brand" href="#">
                    <img src="/docs/5.0/assets/brand/bootstrap-logo.svg" alt="" width="30" height="24" c="d-inline-block align-text-top" />
                </a>
                <div c="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul c="navbar-nav me-auto mb-2 mb-lg-0">
                        <li c="nav-item">
                            <a c="nav-link active" aria-current="page" href="#">Profile</a>
                        </li>
                    </ul>
                    <form c="d-flex">

                        <button cName='btn' onClick={handleLogoutUser} type="submit">logout</button>
                    </form>
                </div>
            </div>
        </nav>
    )
}

export default Header
